control.onControlLoad:
//鼠标点击行激活处理
g5.linkChatId = null;
g5.tableClick = function(sender) {
    var c, x, y;
    for (y = 0; y < g5.pageSize; y++) {
        for (x = 0; x < 7; x++) {
            c = ee.getTableCell(ee.getControl("tablebody2"), x, y);
            c.style.backgroundColor = "";    
        }
    }
    g5.selectedX = Math.max(1, sender.colIndex)
    for (x = 0; x < 7; x++) {
        c = ee.getTableCell(ee.getControl("tablebody2"), x, sender.rowIndex);
        if (x == g5.selectedX) {
            c.style.backgroundColor = "#D0D0FF";
        } else {
            c.style.backgroundColor = "#E0EEFF";
        }
    }
    if (eb.isEmpty(g5.dataset1)) {
        g5.linkChatId = null;
        return;
    }
    g5.regDate = g5.dataset1.getData(0, sender.rowIndex);
    g5.pageCurrent2 = 1;
    queryMyOrder();
}


//分页处理
g5.pageSize = 15;
g5.pageCurrent = 1;
g5.pageCount = 1;
g5.pageJump = function (pageNumber) {
    if (pageNumber < 1) pageNumber = 1;
    if (pageNumber > g5.pageCount) {
        pageNumber = g5.pageCount;
    }
    if (g5.pageCurrent != pageNumber) {
        g5.pageCurrent = pageNumber;
        if (g5.pageCurrent > 0) {
            query();
        }
    }
}
g5.pageSize2 = 6;
g5.pageCurrent2 = 1;
g5.pageCount2 = 1;
g5.pageJump2 = function (pageNumber) {
    if (pageNumber < 1) pageNumber = 1;
    if (pageNumber > g5.pageCount2) {
        pageNumber = g5.pageCount2;
    }
    if (g5.pageCurrent2 != pageNumber) {
        g5.pageCurrent2 = pageNumber;
        if (g5.pageCurrent2 > 0) {
            queryMyOrder();
        }
    }
}

query();

control.onUpdate:
if (text == "IDL") {
    ee.setText(sender, "<font color = '#d03030'>销售</font>");
} else if (text == "OFL") {
    ee.setText(sender, "<font color = '#30a030'>下架</font>");
} else if (text == "DEL") {
    ee.setText(sender, "删除");
} else {
    ee.setText(sender, text);
}

if (eb.isEmpty(g5.dataset2)) return;
var y = sender.rowIndex;
if (y >= g5.dataset2.rowCount) {
    ee.setText(sender, "");
    return;
}
var t = g5.dataset2.getData(16,y);
switch (t) {
    case "NEW": t = "未处理"; break;
    case "CHK": t = "核验通过"; break;
    case "FAL": t = "核验无效"; break;
    case "EP1": t = "数据递<br/>交快递"; break;
    case "EP2": t = "数据递<br/>交失败"; break;
    case "SND": t = "已输出<br/>面单"; break;
    default: t = "未知:" + t; break;
}
ee.setText(sender, t);

