taskSetItem.script2:
var token = eio.readString8();
var pageSize = eio.readInt32();
var pageCurrent = eio.readInt32();
var regDate = eio.readString8();
var selectedX = eio.readInt32();

var sql,sqlResult;
sql = "exec getUserInfoBySession '" + db.encode(token) + "'";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
db.read(sqlResult);
if (db.getString(sqlResult, "sessionId").length < 5) {
    eio.appendString8("F");
    eio.appendString8("token失效");
    es.logWarning("用户token失效, sql=" + sql);
    return;
}   
var userId = db.getString(sqlResult, "id");
var companyId = db.getString(sqlResult, "companyId");

//获取记录数量
switch(selectedX) {
    case 1: selectedX = "NEW"; break;
    case 2: selectedX = "CHK"; break;
    case 3: selectedX = "FAL"; break;
    case 4: selectedX = "EP1"; break;
    case 5: selectedX = "EP2"; break;
    case 6: selectedX = "SND"; break;
    default: selectedX = ""; break;
}
sql =
    "SELECT count(*) as c " +
    "  FROM [TCloud].[dbo].[order] " +
    "  where regDate = '" + db.encode(regDate) + "' and status = '" + db.encode(selectedX) + "' and companyId = " + companyId + " ";
sqlResult = db.executeQuery("DB", sql);   
db.read(sqlResult);
var count = db.getInt32(sqlResult, "c");

//获取详细信息
sql= 
    "SELECT dbo.[order].*, dbo.product.displayName " +
    "FROM dbo.[order] LEFT OUTER JOIN " +
    "      dbo.product ON dbo.[order].productId = dbo.product.id " +
    "  where dbo.[order].regDate = '" + db.encode(regDate) + "' " +
    "      and dbo.[order].status = '" + db.encode(selectedX) + "' and dbo.[order].companyId = " + companyId + " " +
    "  order by dbo.[order].regdatetime ";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
eio.appendString8("T");
eio.appendInt32(count);
eio.appendDataSet(sqlResult,"id,address,address1,address2,address3,mobile,name,orderCount,purchasePrice," +
    "note,regDatetime,expressCode,expressCode1,expressCode2,expressSendCode,expressRecvCode,status,log,displayName",
    pageSize*(pageCurrent-1), pageSize);

