taskSetItem.script1:
if (eb.isEmpty(g5.dataset2)) return;
var count = 0;
var i;
for (i = 0; i < g5.dataset2.rowCount; i++) {
    if (g5.dataset2.getData(10, i).length > 0) count++;
}
if (count == 0) return;
eio.appendString8(eb.getCookie("loginToken"));
eio.appendInt32(count);
for (i = 0; i < g5.dataset2.rowCount; i++) {
    if (g5.dataset2.getData(10, i).length == 0) continue;
    eio.appendString8(g5.dataset2.getData(0, i)); //id
    eio.appendString8(g5.dataset2.getData(10, i)); //Y/N
    eio.appendString16(g5.dataset2.getData(11, i)); //reason
}

taskSetItem.script2:
var token = eio.readString8();

var sql,sqlResult;
sql = "exec getUserInfoBySession '" + db.encode(token) + "'";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    eio.appendString16("系统繁忙请稍后再试");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
db.read(sqlResult);
if (db.getString(sqlResult, "sessionId").length < 5) {
    eio.appendString8("F");
    eio.appendString16("token失效");
    es.logWarning("用户token失效, sql=" + sql);
    return;
}   
var userId = db.getString(sqlResult, "id");
var companyId = db.getString(sqlResult, "companyId");

var count = eio.readInt32();
var rString = "";
for (var i = 0; i < count; i++) {
    var orderId = parseInt(eio.readString8());
    var orderYN = eio.readString8();
    var orderReason = eio.readString16();
    if (orderYN == "Y") {
        sql = "exec orderCheckY " + userId + "," + orderId;
    } else {
        sql = "exec orderCheckN " + userId + "," + orderId + ",'" + db.encode(orderReason) + "'";
    }
    sqlResult = db.executeQuery("DB", sql);
    if (sqlResult == null) {
        eio.appendString8("F");
        eio.appendString16("系统繁忙请稍后再试");
        es.logWarning("数据库执行错误, sql=" + sql);
        return;
    }
    db.read(sqlResult);
    if (db.getInt32(sqlResult, "errorCode") < 0) {
        rString += "操作订单(" + orderId + ")失败：" + db.getString(sqlResult, "errorString") + "\r\n";
    }
}

if (rString.length > 0) {
    eio.appendString8("F");
    eio.appendString16(rString);
} else {
    eio.appendString8("T");
}

